import React, { Component } from "react";
import {characters} from "../characters";

class CharacterDetail extends Component{
    constructor(props){
        super();
        this.state= {
            characterdetail: []
        }
    }

    render(){
        const x = characters[this.props.match.params.id - 1]
        return(
            <div>
                <h1>
                    {x.name}
                    {x.series}
                    {x.images}
                    {x.description}
                    {x.description}
                </h1>

            </div>
        )
    }
}

export default CharacterDetail
